import React, { useState } from 'react';
import Marketplace from './Marketplace';
import KYCVerification from './KYCVerification';

const Dashboard = ({ user, onLogout }) => {
  const [activeTab, setActiveTab] = useState('dashboard');
  const [currentUser, setCurrentUser] = useState(user);

  const handleKYCVerified = (updatedUser) => {
    // Update user KYC status
    const updatedUserData = { ...currentUser, kycStatus: updatedUser.kycStatus };
    setCurrentUser(updatedUserData);
    localStorage.setItem('user', JSON.stringify(updatedUserData));
  };

  const renderContent = () => {
    switch (activeTab) {
      case 'marketplace':
        return <Marketplace user={currentUser} />;
      case 'kyc':
        return <KYCVerification user={currentUser} onKYCVerified={handleKYCVerified} />;
      case 'dashboard':
      default:
        return (
          <div className="dashboard-content">
            <div className="welcome-card">
              <h2>Hello, {currentUser.name}! üëã</h2>
              <p>Welcome to your P2P Exchange dashboard. Start trading currencies with people worldwide.</p>
            </div>

            <div className="status-card">
              <h3>Account Status</h3>
              <div className="status-item">
                <span>Email Verified:</span>
                <span className="status-badge verified">‚úÖ Verified</span>
              </div>
              <div className="status-item">
                <span>KYC Status:</span>
                <span className={`status-badge ${currentUser.kycStatus}`}>
                  {currentUser.kycStatus === 'verified' ? '‚úÖ Verified' : '‚è≥ Pending'}
                </span>
              </div>
              <div className="status-item">
                <span>User ID:</span>
                <span className="user-id">#{currentUser.id}</span>
              </div>
            </div>

            <div className="quick-actions">
              <h3>Quick Actions</h3>
              <div className="action-buttons">
                <button 
                  className="action-btn primary" 
                  onClick={() => setActiveTab('marketplace')}
                >
                  üîç Browse Marketplace
                </button>
                <button 
                  className="action-btn warning"
                  onClick={() => setActiveTab('kyc')}
                >
                  {currentUser.kycStatus === 'verified' ? '‚úÖ KYC Verified' : 'üìã Complete KYC'}
                </button>
                <button className="action-btn info">
                  ‚öôÔ∏è Account Settings
                </button>
              </div>
            </div>
          </div>
        );
    }
  };

  return (
    <div className="dashboard">
      <header className="dashboard-header">
        <div className="header-content">
          <h1>üéØ P2P Exchange</h1>

          <nav className="dashboard-nav">
            <button 
              className={activeTab === 'dashboard' ? 'nav-btn active' : 'nav-btn'}
              onClick={() => setActiveTab('dashboard')}
            >
              Dashboard
            </button>
            <button 
              className={activeTab === 'marketplace' ? 'nav-btn active' : 'nav-btn'}
              onClick={() => setActiveTab('marketplace')}
            >
              Marketplace
            </button>
            <button className="nav-btn">My Ads</button>
            <button className="nav-btn">Orders</button>
          </nav>

          <div className="user-info">
            <span>Welcome, <strong>{currentUser.name}</strong>!</span>
            <button onClick={onLogout} className="logout-btn">
              Logout
            </button>
          </div>
        </div>
      </header>

      <main className="dashboard-main">
        {renderContent()}
      </main>
    </div>
  );
};

export default Dashboard;
